  return (
    <div className="slidershow middle">
      <div className="slides">
        <div className="slide">
          <img src={Women} alt=""/>
        </div>
        <div className="slide">
          <img src={Men} alt=""/>
        </div>
        <div className="slide">
          <img src={Vehicle} alt=""/>
        </div>
      </div>

      div.navi
    </div>
  )
}

export default Banner
